import styled from 'styled-components';
import { motion } from 'framer-motion';
import { useState, useEffect } from 'react';
import CoverSlide from './slides/CoverSlide';
import BigIdeaSlide from './slides/BigIdeaSlide';
import MarketStrategiesSlide from './slides/MarketStrategiesSlide';
import RevenuePotentialSlide from './slides/RevenuePotentialSlide';
import PartnershipsSlide from './slides/PartnershipsSlide';
import DeliverableSlide from './slides/DeliverableSlide';
import ViralStrategySlide from './slides/ViralStrategySlide';

const PitchDeck = () => {
  useEffect(() => {
    const canvas = document.createElement('canvas');
    const ctx = canvas.getContext('2d');
    canvas.style.position = 'fixed';
    canvas.style.top = '0';
    canvas.style.left = '0';
    canvas.style.width = '100%';
    canvas.style.height = '100%';
    canvas.style.pointerEvents = 'none';
    canvas.style.zIndex = '1';
    canvas.style.mixBlendMode = 'soft-light'; // This helps blend the animations
    document.body.appendChild(canvas);

    const resizeCanvas = () => {
      canvas.width = window.innerWidth;
      canvas.height = window.innerHeight;
    };
    
    window.addEventListener('resize', resizeCanvas);
    resizeCanvas();

    const afrobeatsColors = [
      'rgba(255, 215, 0, 0.15)',  // Gold
      'rgba(147, 51, 234, 0.15)', // Purple
      'rgba(34, 197, 94, 0.15)',  // Green
      'rgba(253, 224, 71, 0.15)', // Yellow
      'rgba(236, 72, 153, 0.15)'  // Pink
    ];

    const symbols = ['â™ª', 'â™«', 'â™¬', 'ðŸŽµ', 'ðŸŽ¶'];
    const symbolsArray = [];

    // Create symbols with more natural flow
    for (let i = 0; i < 40; i++) {
      symbolsArray.push({
        x: Math.random() * canvas.width,
        y: Math.random() * canvas.height,
        symbol: symbols[Math.floor(Math.random() * symbols.length)],
        color: afrobeatsColors[Math.floor(Math.random() * afrobeatsColors.length)],
        size: 15 + Math.random() * 30, // Slightly smaller symbols
        rotation: Math.random() * Math.PI * 2,
        speed: 0.15 + Math.random() * 0.3, // Slower movement
        wave: {
          amplitude: 0.5 + Math.random() * 1.5,
          frequency: 0.02 + Math.random() * 0.03,
          offset: Math.random() * Math.PI * 2
        }
      });
    }

    let time = 0;
    const animate = () => {
      ctx.clearRect(0, 0, canvas.width, canvas.height);
      time += 0.01;

      symbolsArray.forEach(symbol => {
        ctx.save();
        
        // Add wavy motion
        const xOffset = Math.sin(time * symbol.wave.frequency + symbol.wave.offset) * symbol.wave.amplitude;
        
        ctx.translate(symbol.x + xOffset, symbol.y);
        ctx.rotate(symbol.rotation);
        
        // Add subtle pulse effect
        const scale = 1 + Math.sin(time * 2 + symbol.wave.offset) * 0.1;
        ctx.scale(scale, scale);
        
        ctx.font = `${symbol.size}px Arial`;
        ctx.fillStyle = symbol.color;
        ctx.globalAlpha = 0.7 + Math.sin(time * 3 + symbol.wave.offset) * 0.3; // Pulsing opacity
        ctx.fillText(symbol.symbol, 0, 0);
        ctx.restore();

        // More natural movement
        symbol.y -= symbol.speed;
        symbol.rotation += 0.005; // Slower rotation

        if (symbol.y < -50) {
          symbol.y = canvas.height + 50;
          symbol.x = Math.random() * canvas.width;
        }
      });

      requestAnimationFrame(animate);
    };

    animate();

    return () => {
      window.removeEventListener('resize', resizeCanvas);
      document.body.removeChild(canvas);
    };
  }, []);

  return (
    <DeckContainer>
      <BackgroundGradient />
      <ContentWrapper>
        <SlideWrapper>
          <SlideContent>
            <CoverSlide />
          </SlideContent>
        </SlideWrapper>
        <SlideWrapper>
          <SlideContent>
            <BigIdeaSlide />
          </SlideContent>
        </SlideWrapper>
        <SlideWrapper>
          <SlideContent>
            <MarketStrategiesSlide />
          </SlideContent>
        </SlideWrapper>
        <SlideWrapper>
          <SlideContent>
            <RevenuePotentialSlide />
          </SlideContent>
        </SlideWrapper>
        <SlideWrapper>
          <SlideContent>
            <PartnershipsSlide />
          </SlideContent>
        </SlideWrapper>
        <SlideWrapper>
          <SlideContent>
            <DeliverableSlide />
          </SlideContent>
        </SlideWrapper>
        <SlideWrapper>
          <SlideContent>
            <ViralStrategySlide />
          </SlideContent>
        </SlideWrapper>
      </ContentWrapper>
    </DeckContainer>
  );
};

const DeckContainer = styled.div`
  width: 100vw;
  min-height: 100vh;
  margin: 0;
  padding: 0;
  position: relative;
  overflow-x: hidden;
  background: #0A0A0F;
`;

const BackgroundGradient = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: radial-gradient(
    circle at center,
    rgba(49, 46, 129, 0.3) 0%,
    rgba(15, 23, 42, 0.5) 100%
  );
  z-index: 0;
`;

const ContentWrapper = styled.div`
  position: relative;
  z-index: 2;
  width: 100%;
  min-height: 100vh;
`;

const SlideWrapper = styled(motion.div)`
  min-height: 100vh;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 2rem;
  position: relative;
  
  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background: radial-gradient(
      circle at 50% 50%,
      rgba(147, 51, 234, 0.05),
      transparent 70%
    );
    pointer-events: none;
  }

  @media (min-width: 1920px) {
    padding: 4rem;
  }
`;

const SlideContent = styled(motion.div)`
  width: 100%;
  max-width: 1920px;
  aspect-ratio: 16/9;
  display: flex;
  align-items: center;
  justify-content: center;
  transform-origin: center;
  position: relative;
  backdrop-filter: blur(10px);
  border-radius: 24px;
  box-shadow: 0 0 40px rgba(147, 51, 234, 0.1);
  overflow: hidden;
  
  &::before {
    content: '';
    position: absolute;
    inset: 0;
    background: linear-gradient(
      135deg,
      rgba(147, 51, 234, 0.05),
      rgba(34, 197, 94, 0.05)
    );
    z-index: -1;
  }

  @media (max-width: 1920px) {
    transform: scale(${props => Math.min(window.innerWidth / 1920, 1)});
  }
`;

export default PitchDeck;
